	/* Calculate length for destined line */
	getIndexFromDistance = function (arr, m){
		/* Metres convert to latlong */
		var length = (m / (metresperminute));
		var index = _.sortedIndex(arr, [0,0,length], function(i){return i[2];});
		return index;
	}



	/* Solution was from vector math http://stackoverflow.com/questions/13302396/given-two-points-find-a-third-point-on-the-line */

/* 	Function that will return the coordinate of a distance upon the array of points that make a line.
	Must have accumulated distance on the third index.
	Have not tested on negative lat lngs, and infinite gradient nor 0 gradient */
	getCoordinateFromDistance = function(arr, m){

		/* Index where the coordinate should be in the line */
		var index = getIndexFromDistance(arr, m);

		/* Length of the distance from start */
		var length = (m / (metresperminute));

		var pt1, pt2, theta, d, orilinelen;

		/* Handle 3 cases of indexes */
		if (index == 0) {
			pt1 = arr[0];
			pt2 = arr[1];
			d = length;
			orilinelen = pt2[2];
		} else if (index >= arr.length-1) {
			pt1 = arr[arr.length-2];
			pt2 = arr[arr.length-1];

			if (m > pt2[2]*metresperminute) length = pt2[2]; /* Longer than the line itself. Reset length to max length */;

			d = length - pt1[2];
			orilinelen = pt2[2] - pt1[2];
		} else {
			pt1 = arr[index-1];
			pt2 = arr[index];
			d = length - pt1[2];
			orilinelen = pt2[2] - pt1[2];
		}

		/* m = ((y1-y2)/(x1-x2)) */
		var slope = ((pt1[0] - pt2[0])/(pt1[1] - pt2[1]));

		/* The angle of the turn for the particular right angle triangle
			tan theta = Opposite / Adjecent, thus:
			tan theta = (x2-x1/y2-y1)
		*/
		theta = (Math.atan(1/slope) * (180/Math.PI));

		/* dx and dy are the normalized unit vectors (rate of change). See http://www.fundza.com/vectors/normalize/ */
		var dx = (pt2[1] - pt1[1]) / orilinelen;
		var dy = (pt2[0] - pt1[0]) / orilinelen;

		var nx = pt1[1] + (dx * d);
		var ny = pt1[0] + (dy * d);

		return [ny,nx];

		/* Some debugging codes
		L.marker([ny,nx], {icon: markericon1}).addTo(map);
		L.polygon([pt1,pt2,[pt2[0],pt1[1]]], {color: (theta < 0) ? "blue":"red"}).addTo(map);
		L.polygon([pt1,[ny,pt1[1]],[ny,nx]], {color: "green"}).addTo(map);
		var start = (slope < 0 ) ? 90 + (90- Math.abs(theta)) : 0;
		L.circle(pt1, 100, {startAngle: start, stopAngle: start+Math.abs(theta), color: "purple"}).addTo(map);
		L.polygon([pt1,pt2,[ny,nx]], {color: (theta < 0) ? "blue":"red"}).addTo(map);
		*/
	}


	getLineFromStartEnd = function(arr, start, end) {
		var startidx = getIndexFromDistance(arr, start);
		var endidx = getIndexFromDistance(arr, end);

		var startcoord = getCoordinateFromDistance(arr, start);
		var endcoord = getCoordinateFromDistance(arr, end);
		var newline = [];
		if ((endidx != 0)) newline = arr.slice(startidx, endidx-1);
		else newline = arr.slice(startidx, arr.length-1);

		newline.splice(0,0,startcoord);
		newline.push(endcoord);

		return newline;
	}

