	/* From http://stackoverflow.com/questions/2825412/draw-a-parallel-line */
	generateParallelBox = function(line, offsetPixels){
	var pt1 = L.point(line[0]);
	var pt2 = L.point(line[1]);
	var result = [];
	var r = pt1.distanceTo(pt2); // Distance pt1 & pt2

	var x1 = pt1.x,
		y1 = pt1.y,
		x2 = pt2.x,
		y2 = pt2.y;

	/* dx = -y / L, dy = x / L */
	var run = (offsetPixels * (y2-y1)) / r;
	var rise = (offsetPixels * (x1-x2)) / r;


	var x1p = x1 + run,
		x2p = x2 + run,
		y1p = y1 + rise,
		y2p = y2 + rise,

		x3p = x1 - run,
		x4p = x2 - run,
		y3p = y1 - rise,
		y4p = y2 - rise;


	/* Push in sequence so that L.polygon properly draw the box */
	result.push([x1p, y1p]);
	result.push([x2p, y2p]);
	result.push([x4p, y4p]);
	result.push([x3p, y3p]);

	//polyline = L.polyline(result, {color:'red'}).addTo(map);
	return L.polygon(result, {color: '#ff2020', fillOpacity: '0.9', opacity: '1.0'}).addTo(map);
	//return result;
	}






