/*** MISC FUNCTIONS****/

function GetDate(str)
{
    var arr = str.split("-");
    var months = ["jan", "feb", "mar", "apr", "may", "jun", "jul", "aug", "sep", "oct", "nov", "dec"];

    var month = months.indexOf(arr[1].toLowerCase());

    return new Date(parseInt("20" + arr[2]), month, parseInt(arr[0]));
}

function compareDate(end) {
    //var stDate = GetDate(start);
    var stDate = new Date();
    var enDate = GetDate(end);
    var compDate = enDate - stDate;
    var day = parseInt(compDate / 1000 / 60 / 60 / 24);

    if (compDate >= 0)
        return day + 1;
    else {
        return day + 1;
    }
}

function compareDates(start, end) {
    var stDate = GetDate(start);
    //var stDate = new Date();
    var enDate = GetDate(end);
    var compDate = enDate - stDate;
    var week = (compDate / 1000 / 60 / 60 / 24 / 7);

    if (compDate >= 0)
        return week.toFixed(2);
    else {
        return week.toFixed(2);
    }
}

