function generateSideMenu(data) {

    jQuery(document).ready(function() {
        jQuery("#menuzord").menuzord({
            align: "right",
            indicatorFirstLevel: "",
            indicatorSecondLevel: "",
			showSpeed: 0,
			hideSpeed: 0
        });
    });


    //console.log(data);
    var ul = $('.menuzord-menu');
    var items = data.slice(0); /* Clone, dont use the passed parameter */
    //lolol = data;


    lookup = {};
    $.each(items, function(idx, i) {
        lookup[i.id] = i;
        lookup[i.id].children = [];
    });

    //here !! continue ilyas
    $.each(items, function(idx, i) {
        var x = i;
        var level = 0;

        /* Inject level */
        while (x.parent != 0) {
            x = lookup[x.parent];
            level++;
            if (level > 999)
                break;
        }
        i.level = level;

        /* Inject children */
        if (i.parent != 0) {
            //if (typeof lookup[i.parent].children == "undefined") lookup[i.parent].children = [];
            lookup[i.parent].children.push(i);
        }
    });


    var add = function(item) {
        if (item.hidden) {
            return
        }
        ; // Don't add hidden menu
        var parent;

        if (item.parent > 0) {

            //parent = ((item.level < 2) ? ul.find('#n' + item.parent + ' .megamenu-row') : ul.find('#n' + item.parent));


        } else {
            parent = ul;
        }



        /* Format: 0=item.name, 1=item.id, 2=item.url */
        var html = '';
        var onclick = ((typeof item.outurl == "undefined") ? (item.url == "#" ? "" : "loadPage(\'{2}\')") : "location.href=\'" + baseURL + item.outurl + "\'");
        //var onclick = (item.outurl == "#" ? "" : "location.href=");
        switch (item.level) {
            case 0:
                html += '<li class="" id="n{1}" style="">';
                html += '<a href="'+ ((typeof item.outurl == "undefined") ? "#": baseURL + item.outurl) +'" onclick="' + onclick + '">{0}</a>';
                if (item.children.length > 0)
                    html += '<div class="megamenu grey ' + ((screenWidth > 1024) ? "megamenu-half-width" : "") + '"><div class="megamenu-row" style=""></div>';
                html += '</div>';
                break;
            case 1:
                parent = ul.find('#n' + item.parent + " .megamenu-row");
                var siblingscount = lookup[item.parent].children.length;
                html += '<li class="item" id="n{1}" style=" padding:0px 5px; float:left; width:' + (100 / siblingscount) + '%">';
                html += '<a class="megamenu-firstlevel" href="javascript:void(0);" onclick="' + onclick + '">{0}</a><ul></ul>';
                break;
            default:
                parent = ul.find('#n' + item.parent + " > ul");
                html += '<li class="" id="n{1}" style="">';
                html += '<a style="'+ ((!item.allow) ? "color: grey; cursor:not-allowed;" : "") +'" class="" href="javascript:void(0);" onclick="' + ((item.allow) ? onclick : "") + '">{0}</a><ul></ul>';
                break;
        }

        html += '</li>';

        html = html.format(item.name, item.id, item.url, item.level);
        //console.log(html);
        parent.append(html);

        return parent.children().last().children();
    };
    var i = 0;
    while (items.length > 0) {
        add(items.shift());
    }
    /*
     packkk = {};
     $('.js-packeryy').each(function(idx){
     console.log('pack');
     packkk[idx] = new Packery(this, {
     itemSelector: '.item',
     gutter: 10,
     isInitLayout: false
     })
     })*/
    /*
     var pckry = new Packery( $('#sidebar_content')[0], {
     // options
     itemSelector: '.item',
     gutter: 10
     });*/
}

function sideMenu() {

    menu = $('#menu');

    $.each(menu.children(), function(key, value) {
        if ($(this).find('li').length != 0) {
            $(this).children('a').before("<a href='#' id='expand'>+ </a>");
        }
    });

    menu.on("click", 'li #expand', function(e) {
        if ($(this).parent().find('>ul').hasClass('open')) {
            $(this).parent().children('ul').removeClass('open').children('li').slideUp();
            e.stopPropagation();
        }
        else {
            $(this).parent().children('ul').addClass('open').children('li').slideDown();
            e.stopPropagation();
        }
    });
}
